try {
   // try to execute the code
} catch (err) {
    // handle errors 
} finally {
   // execute always
}

Running real-world example code.
try {
  alert( 'try' );
} catch (err) {
  alert( 'catch' );
} finally {
  alert( 'finally' );
}

In the above example, the try block is executed first which is then followed by finally as there are no errors.

